class InvocationIoItem:
    def __init__(self):
        raise RuntimeError("InvocationIoItem cannot be instantiated directly")

    # Each enum variant is a nested class of the enum itself.
    class FUNGIBLE:
        address: "Address"
        amount: "EitherGuaranteedOrPredictedDecimal"

        @typing.no_type_check
        def __init__(
            self, address: "Address", amount: "EitherGuaranteedOrPredictedDecimal"
        ):

            self.address = address
            self.amount = amount

        def __str__(self):
            return "InvocationIoItem.FUNGIBLE(address={}, amount={})".format(
                self.address, self.amount
            )

        def __eq__(self, other):
            if not other.is_fungible():
                return False
            if self.address != other.address:
                return False
            if self.amount != other.amount:
                return False
            return True

    class NON_FUNGIBLE:
        address: "Address"
        ids: "EitherGuaranteedOrPredictedNonFungibleIds"

        @typing.no_type_check
        def __init__(
            self, address: "Address", ids: "EitherGuaranteedOrPredictedNonFungibleIds"
        ):

            self.address = address
            self.ids = ids

        def __str__(self):
            return "InvocationIoItem.NON_FUNGIBLE(address={}, ids={})".format(
                self.address, self.ids
            )

        def __eq__(self, other):
            if not other.is_non_fungible():
                return False
            if self.address != other.address:
                return False
            if self.ids != other.ids:
                return False
            return True

    # For each variant, we have an `is_NAME` method for easily checking
    # whether an instance is that variant.
    def is_fungible(self) -> bool:
        return isinstance(self, InvocationIoItem.FUNGIBLE)

    def is_non_fungible(self) -> bool:
        return isinstance(self, InvocationIoItem.NON_FUNGIBLE)


# Now, a little trick - we make each nested variant class be a subclass of the main
# enum class, so that method calls and instance checks etc will work intuitively.
# We might be able to do this a little more neatly with a metaclass, but this'll do.
InvocationIoItem.FUNGIBLE = type(
    "InvocationIoItem.FUNGIBLE",
    (
        InvocationIoItem.FUNGIBLE,
        InvocationIoItem,
    ),
    {},
)  # type: ignore
InvocationIoItem.NON_FUNGIBLE = type(
    "InvocationIoItem.NON_FUNGIBLE",
    (
        InvocationIoItem.NON_FUNGIBLE,
        InvocationIoItem,
    ),
    {},
)  # type: ignore


class _UniffiConverterTypeInvocationIoItem(_UniffiConverterRustBuffer):
    @staticmethod
    def read(buf):
        variant = buf.read_i32()
        if variant == 1:
            return InvocationIoItem.FUNGIBLE(
                _UniffiConverterTypeAddress.read(buf),
                _UniffiConverterTypeEitherGuaranteedOrPredictedDecimal.read(buf),
            )
        if variant == 2:
            return InvocationIoItem.NON_FUNGIBLE(
                _UniffiConverterTypeAddress.read(buf),
                _UniffiConverterTypeEitherGuaranteedOrPredictedNonFungibleIds.read(buf),
            )
        raise InternalError("Raw enum value doesn't match any cases")

    def write(value, buf):
        if value.is_fungible():
            buf.write_i32(1)
            _UniffiConverterTypeAddress.write(value.address, buf)
            _UniffiConverterTypeEitherGuaranteedOrPredictedDecimal.write(
                value.amount, buf
            )
        if value.is_non_fungible():
            buf.write_i32(2)
            _UniffiConverterTypeAddress.write(value.address, buf)
            _UniffiConverterTypeEitherGuaranteedOrPredictedNonFungibleIds.write(
                value.ids, buf
            )


